const cssTemplateString = `
@font-face {
  font-family: "verdana";
  src:
    local("verdana"),
    /* base64 verdana woff, 76.8kb */
    url("data:application/x-font-woff;charset=utf-8;base64,") format("woff");
}
:root {
    --body-font-primary: verdana;
}
@media (prefers-color-scheme: light) {
    :root {
        --basalt-primary-color: 250,249,255;
        --basalt-secondary-color: 255,230,234;
        --basalt-tertiary-color: 255,230,234;
        --basalt-bright-element-color: 255,137,153;
        --basalt-dark-element-color: 255,137,153;
        --general-border-color: 242,218,222;
        /* fk note.ms, your logo is not just yours! */
        /* it's a base64 image, a pink round wop logo :) */
        /* Published under the CC-BY-SA 3.0 License, see https://creativecommons.org/licenses/by-sa/3.0/ */
        --jigglypuff: url('data:image/png;base64,');
        --license-area-logo: var(--jigglypuff);
        --header-logo: var(--jigglypuff);
        --header-logo-size: 75%;
    }
    #header {
        background: #ffe6ea;
        box-shadow: 0 0 10px -4px #000;

    }
    #footer {
        box-shadow: 0 0 10px -4px #000;
    }
}
`;
const styleTag = document.createElement("style");
styleTag.innerHTML = cssTemplateString;
document.head.insertAdjacentElement('beforeend', styleTag);